/*---------------------------------------------------------------------
    File Name: custom.js
---------------------------------------------------------------------*/
jQuery(function () {
	"use strict";

	/* Preloader
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	setTimeout(function () {
		jQuery('.loader_bg').fadeToggle();
	}, 1500);

	/* JQuery Menu
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	jQuery(document).ready(function () {
		if( jQuery('header nav').html() ){
			setTimeout( function(){
				jQuery('header nav').meanmenu();
			},700);
		}
	});

	/* Tooltip
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	jQuery(document).ready(function () {
		setTimeout( function(){
			if( jQuery('[data-toggle="tooltip"]') ){
				jQuery('[data-toggle="tooltip"]').tooltip();
			}
		}, 700);
	});

	/* sticky
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	jQuery(document).ready(function () {
		setTimeout( function(){
			jQuery(".sticky-wrapper-header").sticky({ topSpacing: 0 });
		}, 700);
	});

	/* Mouseover
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	jQuery(document).ready(function () {
		jQuery(".main-menu ul li.megamenu").mouseover(function () {
			if (!jQuery(this).parent().hasClass("#wrapper")) {
				jQuery("#wrapper").addClass('overlay');
			}
		});
		jQuery(".main-menu ul li.megamenu").mouseleave(function () {
			jQuery("#wrapper").removeClass('overlay');
		});
	});
	
	/* NiceSelect
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	jQuery(document).ready(function () {
		if( jQuery('select').html() ){
			setTimeout( function(){
				jQuery('select').niceSelect();	
			}, 700);
		}
		/* NiceScroll
		-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
		if( jQuery(".brand-box").html() ){
			jQuery(".brand-box").niceScroll({
				cursorcolor: "#9b9b9c",
			});
		}
	});
	
	/* ShowPassword-LoginForm
	-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */
	jQuery(document).ready(function () {
		jQuery("#show_password").click(function () {
			var input = jQuery("#user_pass");
			if (input.attr("type") === "password") {
				input.attr("type", "text");
			} else {
				input.attr("type", "password");
			}
		});
	});
});





